import jsPDF from 'jspdf';

export const generateBonPDF = (vehicleData, formData) => {
  const doc = new jsPDF();
  
  // Page dimensions
  const pageWidth = doc.internal.pageSize.getWidth();
  const pageHeight = doc.internal.pageSize.getHeight();
  
  // Logo placeholder (centered, top)
  // You can add a real logo image here later
  doc.setFillColor(200, 50, 50);
  const logoSize = 30;
  doc.circle(pageWidth / 2, 40, logoSize / 2, 'F');
  const logoImg = 'data:image/png;base64,';
doc.addImage(logoImg, 'PNG', (pageWidth - 40) / 2, 20, 40, 40);
  
  // Title
  doc.setFontSize(18);
  doc.setFont('helvetica', 'bold');
  doc.text("BON D'APPROVISIONNEMENT", pageWidth / 2, 75, { align: 'center' });
  
  // Date
  const now = new Date();
  const dateStr = now.toLocaleDateString('fr-FR', { 
    day: '2-digit', 
    month: '2-digit', 
    year: 'numeric' 
  });
  const timeStr = now.toLocaleTimeString('fr-FR', { 
    hour: '2-digit', 
    minute: '2-digit' 
  });
  
  doc.setFontSize(10);
  doc.setFont('helvetica', 'normal');
  doc.text(`Date :`, 20, 95);
  doc.text(`${dateStr} ${timeStr}`, 40, 95);
  
  // Left column
  let y = 110;
  const leftX = 20;
  const leftValueX = 60;
  const lineHeight = 8;
  
  doc.text('Responsable :', leftX, y);
  doc.text(vehicleData.benificiaire, leftValueX, y);
  
  y += lineHeight;
  doc.text('Police :', leftX, y);
  doc.text(vehicleData.police, leftValueX, y);
  
  y += lineHeight;
  doc.text('Marque :', leftX, y);
  doc.text(vehicleData.marque || '-', leftValueX, y);
  
  y += lineHeight;
  doc.text('Service :', leftX, y);
  doc.text(vehicleData.service, leftValueX, y);
  
  y += lineHeight;
  doc.text('Carburant :', leftX, y);
  doc.text(vehicleData.carburant, leftValueX, y);
  
  // Right column
  y = 110;
  const rightX = 120;
  const rightValueX = 180;
  
  doc.text('KM prcdent :', rightX, y);
  doc.text(vehicleData.km.toString(), rightValueX, y, { align: 'right' });
  
  y += lineHeight;
  doc.text('KM actuel :', rightX, y);
  doc.text(formData.km_actuel.toString(), rightValueX, y, { align: 'right' });
  
  y += lineHeight;
  doc.text('Quantit :', rightX, y);
  doc.text(parseFloat(formData.qte).toFixed(1), rightValueX, y, { align: 'right' });
  
  y += lineHeight;
  doc.text('QTE Mensuel :', rightX, y);
  doc.text(vehicleData.quota.toString(), rightValueX, y, { align: 'right' });
  
  y += lineHeight;
  doc.text('Qt Consomme :', rightX, y);
  const newConsomme = vehicleData.qte_consomme + parseFloat(formData.qte);
  doc.text(newConsomme.toFixed(2), rightValueX, y, { align: 'right' });
  
  y += lineHeight;
  doc.text('Reste :', rightX, y);
  const newReste = vehicleData.reste - parseFloat(formData.qte);
  doc.text(newReste.toFixed(1), rightValueX, y, { align: 'right' });
  
  // Separator line
  doc.setLineWidth(0.5);
  doc.line(20, 170, pageWidth - 20, 170);
  
  // Signature lines
  doc.setFontSize(10);
  doc.text('Signature responsable :', 20, 185);
  doc.text('Signature station :', 120, 185);
  
  // Generate filename
  const filename = `bon_${vehicleData.police}_${now.getFullYear()}${String(now.getMonth() + 1).padStart(2, '0')}${String(now.getDate()).padStart(2, '0')}_${String(now.getHours()).padStart(2, '0')}${String(now.getMinutes()).padStart(2, '0')}${String(now.getSeconds()).padStart(2, '0')}.pdf`;
  
  // Save the PDF
  doc.save(filename);
  
  return filename;
};